int CoolMoveSet::GetLandingLag(int MoveId)
{
	return LandingLag[MoveId];
}

int CoolMoveSet::GetMoveLength(int MoveId)
{
	return SkelPoints[MoveId].size();
}

int CoolMoveSet::GetAttackSoundLength(int AttackId)
{
	return AttackSoundLengths[AttackId];
}

